var navScrolling = (function () {
    return {
        init: function () {
            $('a[href^="#"]').click(function(e){
                var el = $(this).attr('href');
                console.log(el.offset.top);
                $('body').animate({
                    scrollTop: el.offset.top + 100}, 2000); //100 замените на любое количество пикселей
                return false;
            });
        }
    }
})();
$(document).ready(function(){
    // Фикмированная шапка при скролле
    $(".navMenu, .only__nav").removeClass("default");
    $(window).scroll(function(){
        if ($(this).scrollTop() > 70) {
            $(".navMenu, .only__nav").addClass("default").fadeIn('fast');
        } else {
            $(".navMenu, .only__nav").removeClass("default").fadeIn('fast');
        };
    });
});


$('.slider').slick({
    dots: true,
    infinite: true,
    speed: 300,
    slidesToShow: 3,
    slidesToScroll: 3,
    responsiveClass:true,
    responsive: [
        {
            breakpoint: 800,
            settings: {
                slidesToShow: 2,
                slidesToScroll: 1
            }
        },
        {
            breakpoint: 550,
            settings: {
                slidesToShow: 1,
                slidesToScroll: 1
            }
        }
    ],
    prevArrow: '<div class="slick-next fa fa-long-arrow-right"><button id="prev" type="button" class="btn btn-juliet"></button></div>',
    nextArrow: '<div class="slick-prev fa fa-long-arrow-left"><button id="next" type="button" class="btn btn-juliet"></button></div>'
});





$('.toggle').focusin(function() {
    $(this).addClass('active');
    $('.search').addClass('move');
});

$('.toggle').focusout(function() {
    $(this).removeClass('active').val("");
    $('.search').removeClass('move');
});



